import React, { Component } from 'react';
import $ from 'jquery';
import './navbar.css';

export class NavBar extends React.Component {
	constructor(props){
		super(props);

	}

	render(){
		return(
			<nav>
			  <div class="logo">
			    <span class="tablet">MyCompany</span>
			    <span class="mobile">MC</span>

			  </div>
			  <ul class="menu-holder">  
			    <li class="navigation">
			      <span class="trigger">Menu</span>
			      <span class="close">close</span>
			      <ul class="menu">
			        <li>
			          <a href="#">Link 1</a>
			        </li>
			        <li>
			          <a href="#">Link 2 </a>
			        </li>
			      </ul>
			    </li>
			    <li class="search">

			      <i class="fa fa-search"></i>
			      <form class="form active"> 
			        <span class="close">close</span>
			        <input type="text" name="seach" />
			      </form>
			    </li>
			  </ul>
			</nav>
		);
	}
}
